import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// Páginas
import Home from './pages/Home'; // Página inicial
import Clientes from './pages/Clientes'; // Página principal de clientes
import CadastroClientes from './pages/CadastroClientes'; // Página de cadastro de clientes
import DetalhesClientes from './pages/DetalhesClientes'; // Página de detalhes de um cliente
import EditarCliente from './pages/EditarCliente'; // Página de edição de um cliente

// Componentes de Orçamentos
import TodosOrcamentos from './components/orcamento/TodosOrcamentos'; // Lista de todos os orçamentos
import CriarOrcamento from './components/orcamento/CriarOrcamento'; // Criar um novo orçamento
import OrcamentosCliente from './components/orcamento/OrcamentosCliente'; // Orçamentos de um cliente específico
import DetalhesOrcamento from './components/orcamento/DetalhesOrcamento'; // Detalhes de um orçamento específico

function App() {
  return (
    <Router>
      <Routes>
        {/* Rota inicial */}
        <Route path="/" element={<Home />} />

        {/* Rotas para clientes */}
        <Route path="/clientes">
          <Route index element={<Clientes />} /> {/* Página principal de clientes */}
          <Route path="cadastro" element={<CadastroClientes />} /> {/* Página de cadastro de clientes */}
          <Route path=":id" element={<DetalhesClientes />} /> {/* Detalhes de um cliente específico */}
          <Route path="editar/:id" element={<EditarCliente />} /> {/* Editar um cliente específico */}
          <Route path=":id/orcamentos" element={<OrcamentosCliente />} /> {/* Orçamentos de um cliente específico */}
        </Route>

        {/* Rotas para orçamentos */}
        <Route path="/orcamentos">
          <Route index element={<TodosOrcamentos />} /> {/* Lista de todos os orçamentos */}
          <Route path="criar" element={<CriarOrcamento />} /> {/* Criar um novo orçamento */}
          <Route path=":id" element={<DetalhesOrcamento />} /> {/* Detalhes de um orçamento específico */}
        </Route>
      </Routes>
    </Router>
  );
}

export default App;
